import React, { Component } from 'react';
import { ScrollView, View, Alert, KeyboardAvoidingView } from 'react-native';
import { TextInput, Button, Card, Avatar, Title, Snackbar, Appbar, RadioButton, Provider as PaperProvider } from 'react-native-paper';
import { setStatusBarHidden, StatusBar } from 'expo-status-bar';

class SignUp extends Component {

    constructor(props) {
        super(props)
        this.state = {
            emailID: "",
            userName: "",
            password: "",
            phoneNumber: "",
            CNIC: "",
            Gender: ""
        }
    }

    onSignUp = () => {
        var data = {
            "email": this.state.emailID,
            "username": this.state.userName,
            "password": this.state.password,
            "phoneNumber": this.state.phoneNumber,
        }

    }
    // Alert.alert(
    //     "Alert Title",
    //     "My Alert Msg",
    //     [
    //         {
    //             text: "Cancel",
    //             onPress: () => console.log("Cancel Pressed"),
    //             style: "cancel"
    //         },
    //         { text: "OK", onPress: () => console.log("OK pressed") }
    //     ],
    //     { cancelable: false }
    // );

    render() {

        const { userName, password, emailID, phoneNumber, CNIC, Gender } = this.state
        return (
            <View style={{ flex: 1, justifyContent: 'center' }}>
                <View style={{ width: '100%', alignSelf: 'center' }}>
                    <StatusBar style="auto" />
                    <KeyboardAvoidingView>
                        <Card>
                            <Card.Content>
                                <Title>Sign Up</Title>
                                <TextInput
                                    label="Email Address"
                                    value={emailID}
                                    onChangeText={text => this.setState({ emailID: text })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    label="User Name"
                                    value={userName}
                                    onChangeText={text => this.setState({ userName: text })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    secureTextEntry={true}
                                    label="Password"
                                    value={password}
                                    onChangeText={text => this.setState({ password: text })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    label="Phone Number"
                                    value={phoneNumber}
                                    onChangeText={phoneNumber => this.setState({ phoneNumber: number })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    label="CNIC Number"
                                    value={CNIC}
                                    onChangeText={number => this.setState({ CNIC: number })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    label="Gender"
                                    value={CNIC}
                                    onChangeText={number => this.setState({ Gender: text })}
                                />
                                <Card.Actions style={{ justifyContent: 'center' }}>
                                    <Button style={{ marginTop: 10, justifyContent: 'center' }} contentStyle={{ height: 50 }}
                                        icon='login' mode="contained"
                                        onPress={() => this.onSignUp()}>
                                        Sign Up
                                </Button>
                                </Card.Actions>
                            </Card.Content>
                        </Card>
                    </KeyboardAvoidingView>
                </View>
            </View>
        )
    }
}
export default SignUp
